import json

lines = raw_text.strip().split('\n')
parsed_leads = []
count = 1

for line in lines:
    if not line.strip(): continue
    
    parts = line.split('\t')
    # Pad parts if missing (some lines might have fewer tabs or empty columns)
    if len(parts) < 13:
        parts += [''] * (13 - len(parts))

    # Columns seem to be:
    # 0: Name, 1: Comp, 2: Role, 3: Quality, 4: Sched month, 5: Sched Date, 6: Cond Month?, 7: Week?, 8: Account, 9: Linkedin, 10: Status, 11: Campaign, 12: Photo
    
    name = parts[0].strip()
    company = parts[1].strip()
    role = parts[2].strip()
    quality = parts[3].strip()
    date_scheduled = parts[5].strip() 
    account = parts[8].strip()
    linkedin = parts[9].strip()
    status = parts[10].strip()
    campaign = parts[11].strip()
    photo = parts[12].strip()

    # Special case for "Shin Ito" line which has empty company col in tab split? 
    # "Shin Ito		Founder..." -> 
    # Let's trust the split. 
    # If company is empty, maybe update?
    
    # Generate ID
    lead_id = f"w6-l{count}"
    count += 1
    
    try:
        q_int = int(quality)
    except:
        q_int = None
        
    lead = {
        "id": lead_id,
        "weekId": "Week 6",
        "name": name,
        "photo": photo if photo and photo != 'no photo' else f"https://ui-avatars.com/api/?name={name.replace(' ', '+')}&background=0D8ABC&color=fff",
        "company": company,
        "role": role,
        "quality": q_int,
        "status": status,
        "dateScheduled": date_scheduled,
        "dateConducted": "February", # Default for Week 6
        "account": account,
        "linkedin": linkedin,
        "comment": "",
        "campaign": campaign
    }
    parsed_leads.append(lead)

with open('week6_leads.json', 'w') as f:
    json.dump(parsed_leads, f, indent=2, ensure_ascii=False)

print("Saved parsed leads to week6_leads.json")
